import { useState, useEffect } from 'react';

function Players() {

    const [data, dataSet] = useState(null);

    useEffect(() => {
        fetch('http://127.0.0.1:8000/api/app/')
        .then(response => dataSet(response.json()))
    })

    return (
        <div id="players-main">
            <h1>Players</h1>
            {data.map((player) => {
                const { name, price} = player;
                return (
                    <div>
                        <p>{name}</p>
                        <p>{price}</p>
                    </div>
                )
            })}
        </div>
    )
}



export default Players;
